    {name:"Mike Scott ",
        genre:"Hip Hop",
        futureEvents: []
    },
    {name:"Tony Stark",
        genre:"Iron Man",
        futureEvents: []
    },
    {name:"First last",
        genre:"Example genre",
        futureEvents: []
    }
]

function Artists(props) {
    return (
